// Input: JSON array or item with .json.fields object
// Output: ONE item with all keyvalue pairs as individual markdown entries in a JSON object

function escapeMd(text) {
  if (text === null || text === undefined) return '';
  const s = String(text);
  return s
    .replace(/\\/g, '\\\\')
    .replace(/([*_`~>|#\-+!.])/g, '\\$1');
}

function normalizeValue(val) {
  if (val === null) return 'null';
  if (typeof val === 'boolean') return val ? 'true' : 'false';
  if (typeof val === 'number') return String(val);
  if (Array.isArray(val)) return JSON.stringify(val, null, 2);
  if (typeof val === 'object') return JSON.stringify(val, null, 2);
  return String(val);
}

function toMarkdown(key, rawVal) {
  const value = normalizeValue(rawVal);
  const hasNewline = /[\r\n]/.test(value);
  const longish = value.length > 140;

  if (hasNewline || longish) {
    return `### ${escapeMd(key)}\n\n\`\`\`\n${value}\n\`\`\``;
  }
  return `- **${escapeMd(key)}**: ${escapeMd(value)}`;
}

function extractFields(items) {
  if (!Array.isArray(items) || items.length === 0) return null;

  const first = items[0]?.json;

  if (first && first.fields && typeof first.fields === 'object') return first.fields;
  if (Array.isArray(first) && first[0]?.fields && typeof first[0].fields === 'object') {
    return first[0].fields;
  }
  if (first && typeof first === 'object') {
    const keys = Object.keys(first);
    const looksLikeFields = keys.some(k => /D\d+/.test(k));
    if (looksLikeFields) return first;
  }

  return null;
}

const fields = extractFields(items);
if (!fields) {
  throw new Error('Could not find a `fields` object in the incoming data.');
}

// Create a single JSON object with each key converted to markdown
const markdownFields = {};
for (const [key, val] of Object.entries(fields)) {
  markdownFields[key] = toMarkdown(key, val);
}

return [
  {
    json: markdownFields,
  },
];

