}

function toMarkdown(key, rawVal) {
  const value = normalizeValue(rawVal);
  const hasNewline = /[\r\n]/.test(value);
  const longish = value.length > 140;

  // Block style for long or multi-line values
  if (hasNewline || longish) {
    return `### ${escapeMd(key)}\n\n\`\`\`\n${value}\n\`\`\`\n`;
  }

  // Compact line for short values
  return `- **${escapeMd(key)}**: ${escapeMd(value)}`;
